import React from 'react';
import styles from './Navbar.module.css';

const navbar = (props) => {
    return (
        <nav className={styles.nav} id='navbar'>
            <div className={styles.nav-content}>
                <h3 onClick={props.click} >RT</h3>
            </div>
            <ul className={styles.nav-items}>
                <li className={styles.nav-items}>Section 1</li>
                <li className={styles.nav-items}>Section 2</li>
                <li className={styles.nav-items}>Section 3</li>
                <li className={styles.nav-items}>Section 4</li>
                <li className={styles.nav-items}>Section 5</li>
            </ul>
        </nav>
    )
};

export default navbar;
